import React, { Component } from "react";
import TweetEmbed from "react-tweet-embed";
class Tweet extends Component {
  render() {
    return (
      <div className="tweet">
        <h2>Tweets</h2>
        <TweetEmbed id="692527862369357824" style={{ width: "100px" }} />
      </div>
    );
  }
}

export default Tweet;
